    false,nt"url": null,nt"notes": "This FEMA Framework Basemap dataset comprises
    the seven FGDC themes of geospatial data that are used by most GIS applications:
    cadastral, geodetic control, governmental unit, transportation, general structures,
    hydrography (water areas & lines), and orthoimagery. The vector data include an
    encoding of the geographic extent of the features and a minimal number of attributes
    needed to identify and describe the features. (Source: Circular A16, p. 13) Also
    included is a digital orthographic imagery dataset. Digital orthographic imagery
    datasets contain georeferenced images of the Earth's surface, collected by a sensor
    in which object displacement has been removed for sensor distortions and orientation,
    and terrain relief. Digital orthoimages have the geometric characteristics of a
    map, and image qualities of a photograph.",nt"license_title": null,nt"extras":
